def reverseComplement2(seq):    '''    >>> reverseComplement2('GATATC')    'GATATC'    >>> reverseComplement2('GCATGC')    'GCATGC'    >>> reverseComplement2('AGCTTC')    'GAAGCT'    '''    seq_list = list(seq)    seq_list.reverse()    new_seq = []    for i in seq_list:        if i == 'A':            new_seq.append('T')        elif i == 'T':            new_seq.append('A')        elif i == 'G':            new_seq.append('C')        elif i == 'C':            new_seq.append('G')    reverse_list = "".join(new_seq)    return reverse_listdef reverseComplement(seq):    '''	>>> reverseComplement('GATATC')	'GATATC'	>>> reverseComplement('GCATGC')	'GCATGC'	>>> reverseComplement('AGCTTC')	'GAAGCT'	'''    dna_dic = { i:j for i,j in zip('ACTG', 'TGAC')}    return ''.join(dna_dic[i] for i in seq[::-1])if __name__ == "__main__":    import doctest    doctest.testmod()